import React, { useState, useEffect } from "react";
import axios from "axios";

const Proveedores = () => {
  const [proveedores, setProveedores] = useState([]); // Lista de proveedores
  const [formData, setFormData] = useState({ nombre: "", description: "" }); // Datos del formulario

  // Obtener la lista de proveedores al cargar el componente
  useEffect(() => {
    fetchProveedores();
  }, []);

  const fetchProveedores = async () => {
    try {
      const response = await axios.get("http://localhost:3002/api/proveedores/lista");
      setProveedores(response.data);
    } catch (error) {
      console.error("Error al obtener proveedores:", error);
    }
  };

  // Manejar el envío del formulario para agregar un proveedor
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:3002/api/proveedores/agregar", formData);
      setFormData({ nombre: "", description: "" }); // Reiniciar formulario
      fetchProveedores(); // Actualizar la lista
    } catch (error) {
      console.error("Error al agregar proveedor:", error);
    }
  };

  // Manejar el cambio en los campos del formulario
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Manejar la eliminación de un proveedor
  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:3002/api/proveedores/eliminar/${id}`);
      fetchProveedores(); // Actualizar la lista
    } catch (error) {
      console.error("Error al eliminar proveedor:", error);
    }
  };

  return (
    <div className="container p-5">
      <div className="row">
        {/* Formulario para agregar proveedores */}
        <div className="col-md-5">
          <h1>Agregar Proveedor</h1>
          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label htmlFor="nombre">Nombre</label>
              <input
                type="text"
                name="nombre"
                placeholder="Ingresa un nombre"
                className="form-control"
                value={formData.nombre}
                onChange={handleChange}
                required
              />
            </div>
            <div className="mb-3">
              <label htmlFor="description">Descripción</label>
              <input
                type="text"
                name="description"
                placeholder="Ingresa descripción"
                className="form-control"
                value={formData.description}
                onChange={handleChange}
                required
              />
            </div>
            <div className="d-flex justify-content-between mt-2">
              <button type="submit" className="btn btn-success">
                Guardar
              </button>
              <a href="/menu" className="btn btn-warning">
                Regresar
              </a>
            </div>
          </form>
        </div>

        {/* Lista de proveedores */}
        <div className="col-md-7">
          <h1>Lista de Proveedores</h1>
          <table className="table">
            <thead>
              <tr>
                <th>Nombre</th>
                <th>Descripción</th>
                <th>Acciones</th>
              </tr>
            </thead>
            <tbody>
              {proveedores.map((proveedor) => (
                <tr key={proveedor._id}>
                  <td>{proveedor.nombre}</td>
                  <td>{proveedor.description}</td>
                  <td>
                    <button
                      onClick={() => handleDelete(proveedor._id)}
                      className="btn btn-danger btn-sm"
                    >
                      Eliminar
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Proveedores;
